  const Div = styled.div`
    display: table;
    width: 100%;
    height: 100%;
  `;
  const Article = styled.div`
    display: table-cell;
    text-align: center;
    vertical-align: middle;
  `;
  const Img = styled.img`
    max-width: 100%;
    max-height: 100%;
    margin: auto;
    display: block;
  `;

  const Section = styled.div`
    max-width: 100%;
    max-height: 100%;
    margin: auto;
    display: block;
    background-color: black;
  `;

